describe("the table example page",function(){var e=require("./page.js");beforeEach(function(){e.get()}),describe("rendering of the tree data",function(){it("should render a tree with 3 root nodes",function(){e.getRootNodes().count().then(function(e){expect(e).toEqual(3)})}),it("should label the nodes correctly",function(){[1,2,3].forEach(function(t){e.getNodeAtPosition(t).getText().then(function(e){expect(e).toBe("node "+t)})})})})});